import React from 'react';
import { Button } from '@mui/material';

function App() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <Button variant="contained" color="primary">
        Hello, Material-UI!
      </Button>
    </div>
  );
}

export default App;
